const TodoItems = (props) => {
	return (

		<li className='list-group-item form-group'>
			<div className='checkbox'>
				<input type='checkbox' onChange={() => handleChange(props.todo.id)} name='check'  checked={props.todo.completed} />
				<label className=''> {props.todo.title} </label>
			</div>
		</li>
	)
}

